import Cardlist from './components/Cardlist'
import Searchbar from './components/Searchbar'
import './App.css';
import Weat from "./api/WeatherSource";

function App() {
  return (
    <div className="App">
     <div className="container searchbar">
       <Searchbar/>
     </div>
     <div>
       <Cardlist/>
     </div>
    </div>
  );
}

export default App;
